import React from "react";
import LibrarySongs from "./LibrarySongs";

const Library = ({ songs }) => {
  return (
    <div className="library-cover">
      <h2>.Library</h2>
      <div className="song-container">
        {songs.map((song) => (
          <LibrarySongs song={song} />
        ))}
      </div>
    </div>
  );
};

export default Library;
